import { useEffect, useState } from "react";
import NavBar from "../Component/NavBar";

function SearchBreed() {
  const [dogs, setDogs] = useState([]);

  useEffect(() => {
    const fetchBreed = async () => {
      try {
        const res = await fetch("https://api.thedogapi.com/v1/breeds", {
          method: "GET",
          headers: {
            "Content-Type": "application/json",
            "x-api-key":
              "live_Xv1NIDcHuYJfH9CnI39Kwmzb0AV6tkxTCQSmsLIaP60jsnCvV9X0T8NZc5Zbl1ak",
          },
        });
        const data = await res.json();
        setDogs(data);
      } catch (error) {
        console.log(error);
      }
    };
    fetchBreed();
  }, []);

  return (
    <div>
      <NavBar></NavBar>
      <div className="container" id="container">
        <h1 className="search-title">Welcome to the dog World</h1>
        <div className="searchbar-border">
          <input
            className="search-bar"
            type="text"
            placeholder="Search for a dog breed"
          ></input>
        </div>

        <div className="grid grid: cols-1 md:grid-cols-2 lg:grid-cols-3 gap-20 my-12 p-8 bg-slate-400 ">
          {dogs.map((dog) => (
            <article key={dog.id}>
              <img className="rounded" src={dog.image.url} key={dog.image.id}></img>
              <h3>{dog.name}</h3>
              <p>{dog.bred_for}</p>
            </article>
          ))}
        </div>
      </div>
    </div>
  );
}

export default SearchBreed;
